import { repTypes } from '../config';
/** 确定待发送item优先级 */
export function findPrority(type) {
    for (var i in repTypes) {
        var t = repTypes[i];
        if (t.name === type) {
            return t.priority;
        }
    }
    return Number.MIN_VALUE;
}
var MIN_CACHE_PRIORITY = 100;
/** 根据优先级确定是否需要缓存 */
export function needCache(data) {
    for (var i in repTypes) {
        var t = repTypes[i];
        if (t.name === data.type) {
            return t.priority >= MIN_CACHE_PRIORITY;
        }
    }
    return false;
}
